import { useState } from "react"


export default function GameHistory({ HistoryArray}) {
    return (
        <ol>
            {
                Array(HistoryArray.length).fill(null).map(
                    (_,i) => (
                        <li key={i+1}>game {i+1} </li>
                    )
                )
            }
        </ol>
    );
}
